import PropTypes from 'prop-types';
import Modal from '../../shared/Modal/Modal';
import Input from '../../shared/Input/Input';

const CreateConfigurationModal = props => {
    const { onModalClose, onModalShow, onModalOk, onModalCancel, isModalVisible } = props;

    return (
        <Modal
            onModalClose={onModalClose}
            onModalShow={onModalShow}
            onModalOk={onModalOk}
            onModalCancel={onModalCancel}
            isConfigurationModalShow={isConfigurationModalShow}
            className={'mb-32'}
            title={'test'}
            showClose
            showFooter
        >
            <Input type={'text'} placeholder={'Name'} />
        </Modal>
    );
};

CreateConfigurationModal.propTypes = {};

export default CreateConfigurationModal;
